      //     { isModalOpen && <Modal closeModalFn={this.closeModal} /> }
      //   </AppContext.Provider>
      // </BrowserRouter>

      <div id="website">
        <div id="logo"><Logo /></div>
        <div id="nav">
        <div className="example">
          <div id="navItem" ><span className="hover hover-3">O nas </span>|</div>
          <div id="navItem" ><span className="hover hover-3">&nbsp;Oferta </span>|</div>
          <div id="navItem" ><span className="hover hover-3">&nbsp;Portfolio </span>|</div>
          <div id="navItem" ><span className="hover hover-3">&nbsp;Kontakt</span></div>
          </div>
        </div>

       {this.state.isHomeViewOpen === true ? <HomeView/> : <PhotosView stateChange={this.ZobaczWiecejClicked}/>} 

